    string constant public name = "DEMORE";
    string constant public symbol = "DRE";
    uint8 constant public decimals = 18;
    uint256 constant public initialSupply = 566 * 10**18;

    constructor () {

        _mint(msg.sender, initialSupply);
    }
}
